// JavaScript Document for gh_ios
var PDFGenerator={


	
create:function(comercial,customer,shopcart,observaciones) {
	
	// Propiedades PDF
	var doc = new jsPDF();
	doc.page = 1;
	doc.setFont('helvetica');
	doc.setFontSize(10);
	
	// Paginador
	function footer(){
		doc.text(12,285, '1' + '/' + doc.page);
		doc.page++;
	};

	// Set properties on the document
		doc.setProperties({
		title: 'Albaran',
		subject: 'Envio  mail de albaran',
		author: 'Comercial'+ comercial,
		keywords: 'guantes, gahibre, industrial, manufactura',
		creator: 'Aidiapp'
	});
	
console.log("CREANDO UN PDF CON EL COMERCIAL "+comercial);
	// Datos COMERCIAL	
	doc.setFontType('bold');
	doc.text(105, 30, 'COMERCIAL:');
	doc.text(105, 38, 'DATOS CLIENTE:');

	// Recuadro datos COMERCIAL
	doc.setFontType('regular');
	doc.rect(100,20,100,50);
	doc.text(132, 30, comercial);
	doc.text(105, 46, customer.nombre);
	doc.text(105, 52, customer.nif);
	doc.text(105, 58, customer.direccion+' ('+customer.codigoPostal+')');
	doc.text(105, 64, customer.municipio+' ('+customer.provincia+')');
	
	console.log("La direcci√≥n del customer es "+customer.direccion+' ('+customer.codigoPostal+')');
	
	// Logo Gahibre
	var imgData = 'data:image/png;base64,';

	doc.addImage(imgData, 'PNG', 20, 10, 40, 40);	
	
	// TABLAS 
	doc.rect(20, 80, 180, 135); // Art√≠culos
	doc.setFontType('bold');
	doc.setFontSize(8);
	doc.text(23, 86, 'ART√çCULOS');
	doc.text(76, 86, 'TALLA');
	doc.text(110, 86, 'CANTIDAD');
	doc.text(138, 86, 'DTO');
	doc.text(150, 86, 'PRECIO/UD');
	doc.text(175, 86, 'SUBTOTAL');
	doc.setLineWidth(0.2);
	doc.line(74, 215, 74, 80); // l√≠neas verticales
	doc.line(108, 215, 108, 80); // l√≠neas verticales
	doc.line(136, 215, 136, 80); // l√≠neas verticales
	doc.line(148, 215, 148, 80); // l√≠neas verticales
	doc.line(173, 215, 173, 80); // l√≠neas verticales
	doc.line(20, 90, 200, 90);	// l√≠nea horizontal
	
	
	
	var initY=95;
	var total=0;
	doc.setFontSize(9);
	for(x in shopcart){
			console.log("Vamos a generar en el PDF la linea de producto "+x)
				
				for(tt in shopcart[x].tallas){
					//Si la cantidad es 0 nos lo saltamos
					if(shopcart[x].tallas[tt].cantidad<1) break;
					
					console.log("GEnerando la linea de talla "+shopcart[x].tallas[tt].talla+" de "+x);
					doc.text(23, initY, shopcart[x].detail.modelo);
					doc.text(76, initY, shopcart[x].tallas[tt].talla);
					console.log("GEnerando la linea de cantidad "+shopcart[x].tallas[tt].cantidad+" de "+x);
					doc.text(110, initY, shopcart[x].tallas[tt].cantidad);
					//s√≥lo se calcula la cantidad si no es centro comercial
					if(customer.tipo!="CENTRO COMERCIAL"){
					console.log("GEnerando la linea de descuento "+shopcart[x].tallas[tt].descuento+" de "+x);
					doc.text(138, initY, shopcart[x].tallas[tt].descuento);
					console.log("GEnerando la linea de precio "+shopcart[x].detail.precio+" de "+x);
					doc.text(150, initY, shopcart[x].detail.precio+' ‚Ç¨');
					console.log("GEnerando la linea de subtotal "+shopcart[x].tallas[tt].subtotal+" de "+x);
					doc.text(175, initY, shopcart[x].tallas[tt].subtotal+' ‚Ç¨');
					console.log("Y ahora vamos a realizar la operacione de total ");
				total=eval(total+'+'+shopcart[x].tallas[tt].subtotal);
				console.log("El total es "+total);
					}
				initY+=8;	
				}
				
		}
	
		
	
	
	// Texto al margen ALBAR√ÅN
	doc.setFontSize (10);
	doc.text(12, 170, 'ALBAR√ÅN DE PEDIDO', null, 90);
if(customer.tipo!="CENTRO COMERCIAL"){
	doc.rect(115, 220, 85, 10); // TOTAL 
	
	doc.setFontSize(10);
	doc.text(118, 226, 'TOTAL: ');
	doc.text(138, 226, ' '+total+' ‚Ç¨');
}
	console.log("Las observcaiones son "+observaciones);
	doc.rect(20, 235, 180, 40);	// Observaciones
	doc.text(23, 241, 'OBSERVACIONES: ');
	doc.setFontSize(8);
	doc.setFontType('regular');
	if(observaciones!=null && typeof(observaciones)!='undefined'){
	doc.text(23, 251, observaciones);
	}

	footer();
	
	console.log("Devolvemos el doc");
	return doc.output("blob");
	
}

}